import React, { Component } from "react";
import "./Completar";
import Completar from "./Completar";

class Ejercicio extends Component {
  state = {};

  render() {
    return (
      <div>
        <input type="text" />

        <button
          onClick={() => Completar}
          className="btn btn-primary m-2"
          aria-label="Left Align"
        >
          <b>+</b>
        </button>
      </div>
    );
  }
}

export default Ejercicio;
